import React from "react";

const HeaderLogo = () => (
  <>
    <a href="/en-ca/" className="flex-grow-10">
      <picture>
        <img
          className="block w-6"
          srcSet="/images/header-logo.svg 640w, /images/header-logo-small.svg 320w"
          alt="IfItDoesntMatchAnyMedia"
        />
      </picture>
    </a>
  </>
);
export default HeaderLogo;
